// SPDX-License-Identifier: GPL-3.0
//version of solidity we are using for this smart contract code
pragma solidity >=0.7.0 <0.9.0;

// Similar to class, that has some variables and methods, so we can deploy an instance into etherium
contract Inbox {
    address public manager;
    address[] public players;

    constructor() {
        manager = msg.sender;
    }

    // Allows users to enter the contract by sending Ether (payable function)
    function enter() public payable { // Add money to the contract address
        require(msg.value > 0.01 ether, "Minimum Ether required is 0.01"); // Require statement for validation
        players.push(msg.sender); // Add the sender's address to the players array
    }

    // Generates a pseudo-random number (for educational purposes, not secure for production)
    function random() private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, players)));
    }

    function pickWinnder() public restricted{

       require(msg.sender == manager, "Only the manager can pick a winner");

       uint index = random() % players.length;

        //    players[index].transfer(this.balance); //this.balance is balance of the address who deployed
        payable(players[index]).call{value:address(this).balance}; //this.balance is balance of the address who deployed

        players = new address[](0); // initialize with length
    }

    modifier restricted(){
        require(msg.sender == manager);
        _;
    }

    function getPlayers() public view returns ( address[] memory){
        return players;
    }
}

