//  getMessage(); => Function name declaration
//  public view: => Function type declaration
        // WE CAN USE ONLY ONE PER FUNCTION OF PUBLIC OR PRIVATE
        // public -> Any one can call this function
        // private  -> Only this contract can call this function.

        // VIEW(new) AND CONSTANT(old) MEAN THE SAME THING
        // view -> This function returns data and does not modify the contract's data
        // constant -> This function returns data and does not modify the contract's data

        // pure -> Function will not modify or even read the contract's data
        // payable -> When someone call this function they might send ether along
// RETURNS: It will tell that it is going to return data
      //Mostly use on view and constant

// }

